function JihokuLineDraw(lon,lat)	{

	//m
	lonlat2 = new OpenLayers.LonLat(lon,lat).transform(projection900913,projection4326);
	
	var px = lonlat2.lon;
	var py = lonlat2.lat;	

	//(10)6
	px = px * 1000000;
	px = parseInt(px);
	px = px / 1000000;
	py = py * 1000000;
	py = parseInt(py);
	py = py / 1000000;

	//
	var pi = Math.PI;
 
	//
	var KEE=px-138;
	var KNN=py-37;
	//var KKK=(7+40.644/60)+(18.976/60)*KNN-(6.224/60)*KEE+(0.003/60)*KNN*KNN+(0.024/60)*KNN*KEE-(0.586/60)*KEE*KEE;		//20110928	2010
	var KKK=(7+40.585/60)+(19.003/60)*KNN-(6.265/60)*KEE+(0.009/60)*KNN*KNN+(0.024/60)*KNN*KEE-(0.591/60)*KEE*KEE;		//20140129	
	KKK=parseInt(KKK*100 + 0.5)/100;
	var KKK_NUM=parseInt(KKK*10 + 0.5)/10;		//
	
	//
	//
	KKK=KKK*pi/180;
	var HHH=Math.sin(KKK)/Math.cos(KKK);
	
	//1km
	var EEE_D=6378.137*pi*Math.cos(py*pi/180);
	EEE_D=180/EEE_D;
	var NNN_D=180/6378.137/pi;
 
	//3km
	var LLL=3;
	var H1=px-LLL*HHH*EEE_D;
	var H2=px+LLL*HHH*EEE_D;
	var V1=py+LLL*NNN_D;
	var V2=py-LLL*NNN_D;
	//
		
	var points = new Array(
		new OpenLayers.Geometry.Point(H1,V1),
		new OpenLayers.Geometry.Point(H2,V2)
	);
	var line = new OpenLayers.Geometry.LineString(points);
	line.transform(projection4326,projection900913);
	
	//
	var cPoint = new OpenLayers.Geometry.Point(px,py);
	cPoint.transform(projection4326,projection900913);
	
	//
	var style = {
		strokeColor: '#ff0000',
		strokeOpacity: 0.8,
		strokeWidth: 1
	};
	
	var lineFeature = new OpenLayers.Feature.Vector(line, null, style);
	var pointFeature = new OpenLayers.Feature.Vector(cPoint);
	pointFeature.attributes = {
		label: KKK_NUM
	}
	
	// feature
	jihokuLayer.addFeatures([lineFeature,pointFeature]); //, 
	
	if(popupflag)	{
		map.removePopup(popup);		//
		popupflag = 0;
	}
}
 
