function getSelectedLayerString(nextIndex) {

	if (pluginModule) {
		var url = ""
		var idx = nextIndex;
		for (var i = 0; i < pluginModule.length; i++) {
			var ret = pluginModule[i].getSelectedLayerString(idx);
			
			if (ret) {
				url = url + ret.layerString;
				idx = ret.nextIndex;
			}
		}
	
		if (nextIndex < idx){
			return {
				layerString: url,
				nextIndex: idx
			};
		}
	}
}

